                <section class="flex-module editorial" id="editorial-1">

                    <div class="box  editorial">

                        <div class="cf flex-1up flex-tile flex-same-height cols-nested " data-flex-flip="">
                            <div class="col editorial-result-card ">
                                <div class="flex-card editorial-result-card ">
                                    <div class="flex-content">
                                        <div class="flex-area-primary">
                                            <div class="flex-app-content">
                                                <h5> Flights from Dublin Airport</h5>
                                                <p> Flights from Dublin depart from the city&#39;s main airport, which is located 10 kilometres to the north of the city centre. It has two terminals, both of which are served by a range of transport options, although there is no direct rail link. To compensate, the airport has a range of bus routes to take passengers all over Ireland. The Air Link and Airport Hopper services are dedicated airport routes that run directly into the city centre.</p>
                                                <p> Alternatively, it is possible to park at Dublin Airport, which has some 14,400 spaces allocated to long-term travellers and 3,600 short-stay spaces on offer, as well as provision for disabled parking. Regular travellers who are members of the Airport Club benefit from discounts in the short-stay car parks, as well as being fast-tracked through security.</p>
                                                <p> Passengers on the flights Dublin offers can enjoy a range of shops in The Loop to keep them entertained before flying. The Click &amp; Pick Up service also enables travellers to order duty free goods online and collect them at the airport, either on the way out or on their return journey. Passengers are also offered a host of restaurants and dining options, ranging from quick sandwiches to more leisurely sit-down meals and bars, including a champagne bar. For passengers seeking a comfortable and relaxing experience, the airport also provides executive lounges that can be used for up to three hours for a small charge. The facilities include a business centre with free Wi-Fi and complimentary refreshments and newspapers.</p>
                                                <p> The best deals on flights from Dublin to Seattle can be found at ebookers.ie, where accommodation and car rental can also be arranged.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="col editorial-result-card ">
                                <div class="flex-card editorial-result-card ">
                                    <div class="flex-content">
                                        <div class="flex-area-primary">
                                            <div class="flex-app-content">
                                                <h5>Arriving in Seattle</h5>
                                                <p>Seattle-Tacoma International Airport, known as Sea-Tac, is thirteen miles south of Seattle and eighteen miles north-east of Tacoma. More than twenty airlines operate out of Sea-Tac, handling millions of passengers every year. These include Air Canada, American Airlines, United Airlines and British Airways. Visit ebookers to find great deals and discounts on flights to Seattle.</p>
                                                <h5>Transportation from the Airport</h5>
                                                <p>There are many transportation options available from the airport. You can catch the Link Light Rail system on the fourth floor of the airport garage, and you'll find courtesy buses for area hotels on the garage's third floor. If you prefer more private transportation, you can find taxi services on the third floor or rent a car from one of the twelve rental agencies located in the rental car facility. Dedicated shuttle buses near the baggage claim area transport passengers to the rental car facility twenty-four hours a day. For your convenience, you can book your transportation ahead of time by visiting ebookers.</p>
                                                <h5>Weather in Seattle</h5>
                                                <p>Seattle's reputation for wet weather is no exaggeration. The city has only about seventy clear, sunny days per year. You can expect some form of precipitation during any trip, although the weather is relatively mild and usually has no thunderstorms or blizzards. The best months to visit are July, August, and September, when temperatures average 24°C. Winter temperatures can dip to 8°C and occasionally it snows.</p>
                                                <h5>Seattle Tourist Attractions</h5>
                                                <p>There are plenty of sights to see in Seattle, including the famous Space Needle, the original Starbucks, and the home of Microsoft founder Bill Gates. Art lovers will likely enjoy the Seattle Art Museum and the Seattle Children's Museum, and science lovers can visit the Seattle Aquarium or the Pacific Science Centre. When spending time outdoors, be sure to remember your umbrella. Whether you're traveling to Seattle for business or pleasure, start your trip with a visit to ebookers and find great deals on flights to Seattle.</p>
                                            </div>
